function main() {
//==============================================================================
  // Retrieve <canvas> element
  

  // Get the rendering context for WebGL
  gl = getWebGLContext(canvas);
  if (!gl) {
    console.log('Failed to get the rendering context for WebGL');
    return;
  }

  // Initialize shaders
  if (!initShaders(gl, VSHADER_SOURCE, FSHADER_SOURCE)) {
    console.log('Failed to intialize shaders.');
    return;
  }

  // 
  var n = initVertexBuffer(gl);
  if (n < 0) {
    console.log('Failed to set the vertex information');
    return;
  }

canvas.onmousedown	=	function(ev){myMouseDown( ev, gl, canvas) }; 
  // when user's mouse button goes down, call mouseDown() function
canvas.onmousemove = 	function(ev){myMouseMove( ev, gl, canvas) };
						// when the mouse moves, call mouseMove() function					
canvas.onmouseup = 		function(ev){myMouseUp(   ev, gl, canvas)};

  // Specify the color for clearing <canvas>
  gl.clearColor(0.0, 0.0, 0.0, 1.0);

	// NEW!! Enable 3D depth-test when drawing: don't over-draw at any pixel 
	// unless the new Z value is closer to the eye than the old one..
//	gl.depthFunc(gl.LESS);			 // WebGL default setting: (default)
	gl.enable(gl.DEPTH_TEST); 	 
	 
//==============================================================================
// STEP 4:   REMOVE This "reversed-depth correction"
//       when you apply any of the 3D camera-lens transforms: 
//      (e.g. Matrix4 member functions 'perspective(), frustum(), ortho() ...)
//======================REVERSED-DEPTH Correction===============================

  //  b) reverse the usage of the depth-buffer's stored values, like this:
  //gl.enable(gl.DEPTH_TEST); // enabled by default, but let's be SURE.
  //gl.clearDepth(0.0);       // each time we 'clear' our depth buffer, set all
                            // pixel depths to 0.0  (1.0 is DEFAULT)
  //gl.depthFunc(gl.LESS); // draw a pixel only if its depth value is GREATER
                            // than the depth buffer's stored value.
                            // (gl.LESS is DEFAULT; reverse it!)
//=====================================================================

  // Get handle to graphics system's storage location of u_ModelMatrix
  window.addEventListener("keydown", myKeyDown, false);

  u_ModelMatrix = gl.getUniformLocation(gl.program, 'u_ModelMatrix');
  if (!u_ModelMatrix) { 
    console.log('Failed to get the storage location of u_ModelMatrix');
    return;
  }
var g_last = Date.now();
//-----------------  
  // Start drawing: create 'tick' variable whose value is this function:
  var tick = function() {

	var now = Date.now();
  	var elapsed = now - g_last;
 	 g_last = now;
    currentAngle = animate(currentAngle);  // Update the rotation angle

	if(g_angle01 >  20.0 && g_angle01Rate > 0) g_angle01Rate = -g_angle01Rate;
	if(g_angle01 <  -20.0 && g_angle01Rate < 0) g_angle01Rate = -g_angle01Rate;
	
	g_angle01 = g_angle01 + (g_angle01Rate * elapsed) / 1000.0;
	if(g_angle01 > 180.0) g_angle01 = g_angle01 - 360.0;
	if(g_angle01 <-180.0) g_angle01 = g_angle01 + 360.0;

	if(ypos > 5 && movrate > 0) ypos = -4;
	//if(ypos < -0.8 && movrate < 0) movrate = -movrate;
  
	ypos = ypos + (movrate * elapsed) / 50.0;
    drawResize();   // Draw shapes
    // report current angle on console
    //console.log('currentAngle=',currentAngle);
    requestAnimationFrame(tick, canvas);   
    									// Request that the browser re-draw the webpage
  };
  tick();							// start (and continue) animation: draw current image
    
}

